import { Routes, Route } from "react-router-dom";
import Home from "./Components/Home/Home";

import "./App.css";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="spotify-home" element={<Home />} />
      </Routes>
    </div>
  );
}

export default App;
